import React from 'react'
import { Link } from 'react-router-dom'
import { logOut } from './actions'
import { connect } from 'react-redux'

class Auth extends React.Component {

  onSubmit(){
    this.props.logOut();
  }

  renderAuthButton () {

    if(localStorage.getItem("validToken")){
      return (
       <div className='ui secondary pointing menu'>
             <div className="ui list">
              <div><Link to ='/post/list'>veiw all post</Link></div>
              <div><Link to ='/post/create'>create your own post</Link></div>
              <div><button><Link to ='/' onClick = {this.onSubmit}>logout</Link></button></div>

            </div> 
        </div>
      );
    }

  }

  render () {
    return <div>{this.renderAuthButton()}</div>;
  }
}

export default connect(null , { logOut})(Auth)
